// MODES
// all modes
alias flashMode "resetAll;enableFlash"
alias iceMode "resetAll;startIce"
alias turnMode "resetAll;enableSlowTurn"
alias douyinMode "resetAll;enableDouyin"

// modes loop
alias executeMode "turnMode"
alias nextModey "mode1"
alias mode1 "alias executeMode flashMode; alias nextModey mode2"
alias mode2 "alias executeMode iceMode; alias nextModey mode3"
alias mode3 "alias executeMode turnMode; alias nextModey mode4"
alias mode4 "alias executeMode douyinMode; alias nextModey mode5"
alias mode5 "alias executeMode turnMode; alias nextModey mode6"
alias mode6 "alias executeMode iceMode; alias nextModey mode7"
alias mode7 "alias executeMode flashMode; alias nextModey mode8"
alias mode8 "alias executeMode douyinMode; alias nextModey mode1"

// modes slow loop (we switch modes every ~2 minutes. without this loop it only switches every 60 seconds)
alias slowmodeLoop slowmodeLoop1
alias slowmodeLoop1 "alias slowmodeLoop slowmodeLoop2"
alias slowmodeLoop2 "alias slowmodeLoop slowmodeLoop1;goNext;maxwin"

// START COMMANDS
snd_toolvolume 0.5
resetAll
cl_crosshair_drawoutline false
cl_show_observer_crosshair 0
alias mouseFunc nextModey


alias firstCommand "goNext;alias tack slowmodeLoop"
// W only calls commands when ingame, starts the first mode when pressed and resets itself after
bind scancode26 "+forward;bind scancode26 +forward;firstCommand"


// USER COMMANDS
alias goNext "nextModey;executeMode;alias slowmodeLoop1 alias slowmodeLoop slowmodeLoop2"
alias clearPerma "resetAll;alias tack nun"
alias smileyBS "clearPerma"
